import React from 'react';

const NavBar = () => {
    return (
        <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/profiles">Search</Link>
          </li>
          <li>
            <Link to="/profile:id">Profile</Link>
          </li>
        </ul>
      </nav>
    );
};

export default NavBar;
